import './App.css';
import { ThemeProvider } from '@mui/material/styles';
import theme from './theme';
import { Button } from '@mui/material';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'

function App() {
  return (
    <Router>
      <div className="App">
        <div className='content'>
          <Switch>
            <Route path='/'></Route>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
